import React from "react";

import MainText from '../components/Homepage/MainText';
import SubText from "../components/Homepage/SubText";

import leaf from '../images/leaf.png';
import matcha from '../images/matcha2.png';
import styles from "./Homepage.module.css";

const Homepage = () => {


  return (
    <div className={styles.container}>
      <div className={styles.container__sub}>
        <MainText />
        <div className={styles.background}></div>
        <img src={leaf} className={styles.mainImg}></img>
      </div>
      <div className={styles.container__sub2}>
        <SubText />
        <div className={styles.subBackground} onClick={imageClickHandler}></div>
        <img src={matcha}  className={styles.subImg} />
      </div>
    </div>
  );
};

export default Homepage;
